import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react-router-dom";

const Login = () => {
  return (
    <div className="wrapper">
      <section className="container-login">
        <div className="card rounded-3 shadow-lg w-100">
          <div className="row g-0">
            {/* Left side */}
            <div className="col-lg-6 d-flex flex-column justify-content-center align-items-center p-4">
              <div className="text-center">
                <Link
                  to="/"
                  className="logo d-flex flex-column align-items-center text-decoration-none mb-3"
                >
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="30"
                    height="30"
                    fill="#0f0f1d"
                    className="bi bi-fork-knife"
                    viewBox="0 0 16 16"
                  >
                    <path d="M13 .5c0-.276-.226-.506-.498-.465-1.703.257-2.94 2.012-3 8.462a.5.5 0 0 0 .498.5c.56.01 1 .13 1 1.003v5.5a.5.5 0 0 0 .5.5h1a.5.5 0 0 0 .5-.5zM4.25 0a.25.25 0 0 1 .25.25v5.122a.128.128 0 0 0 .256.006l.233-5.14A.25.25 0 0 1 5.24 0h.522a.25.25 0 0 1 .25.238l.233 5.14a.128.128 0 0 0 .256-.006V.25A.25.25 0 0 1 6.75 0h.29a.5.5 0 0 1 .498.458l.423 5.07a1.69 1.69 0 0 1-1.059 1.711l-.053.022a.92.92 0 0 0-.58.884L6.47 15a.971.971 0 1 1-1.942 0l.202-6.855a.92.92 0 0 0-.58-.884l-.053-.022a1.69 1.69 0 0 1-1.059-1.712L3.462.458A.5.5 0 0 1 3.96 0z" />
                  </svg>
                  <h5 className="site-title mt-2 mb-0">Saanjh by Rajasthan</h5>
                </Link>

              </div>

              <form className="w-100 ">
                <p className="text-start">Please login to your account</p>

                <div className="form-outline mb-2">
                  <input
                    type="email"
                    className="form-control"
                    placeholder="Email address"
                  />
                  <label className="form-label mt-1">Username</label>
                </div>

                <div className="form-outline mb-3">
                  <input type="password" className="form-control" />
                  <label className="form-label mt-1">Password</label>
                </div>

                <div className="d-flex justify-content-between align-items-center mb-3">
                  <button type="button" className="btn btn-primary gradient-btn px-4">
                    Log in
                  </button>
                  <a href="#!" className="text-muted">
                    Forgot password?
                  </a>
                </div>

                <div className="text-center">
                  <p>
                    Don't have an account?{" "}
                    <button type="button" className="btn btn-outline-danger btn-sm ms-2">
                      Create new
                    </button>
                  </p>
                </div>
              </form>
            </div>

            {/* Right side */}
            <div className="col-lg-6 d-none d-lg-flex gradient-panel text-white text-center align-items-center justify-content-center p-4">
              <div>
                <h4 className="mb-3">We are more than just a company</h4>
                <p className="small mb-0">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod
                  tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim
                  veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea
                  commodo consequat.
                </p>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Custom Styles */}
      <style jsx>{`
        .wrapper {
          height: 100dvh;
          padding: 2rem 1rem;
          box-sizing: border-box;
          background: #f1f1f1;
          display: flex;
          align-items: center;
          justify-content: center;
        }

        .container-login {
          max-width: 900px;
          width: 100%;
        }

        .gradient-panel {
          background: linear-gradient(to right, #ee7724, #d8363a, #dd3675, #b44593);
          border-top-right-radius: 0.3rem;
          border-bottom-right-radius: 0.3rem;
        }

        .gradient-btn {
          background: linear-gradient(to right, #ee7724, #d8363a, #dd3675, #b44593);
          border: none;
        }

        .gradient-btn:hover {
          opacity: 0.9;
        }

        .site-title {
          font-size: 1rem;
          color: #0f0f1d;
          font-weight: 600;
        }

        .logo svg {
          width: 28px;
          height: 28px;
        }
      `}</style>
    </div>
  );
};

export default Login;
